At James Wellbeloved, a lot of love is put into the creation of recipes dogs will love. Using only simple ingredients and inspired by nature, James Wellbeloved dog food has all the goodness they need - and nothing they don't. And, to minimise the risk of adverse food reactions, it's naturally hypoallergenic. Best of all, you can be sure your canine friend is enjoying a balanced diet. One that not only tastes good, but does them a world of good too.

Using all their knowledge and experience of dog foods, James Wellbeloved have created dog wet food pouches. They have taken a handful of ingredients from nature, one source of animal protein and combined them with all the vitamins and minerals your dog needs. And all the great taste it deserves. For added peace of mind, it's naturally hypoallergenic so less likely to cause an adverse food reaction and you will never see any added artificial colours, flavours or preservatives. Not now, not ever.

This product contains the following special ingredients and benefits to care for your dog's health and wellbeing:
-Turkey - Made with 100% natural turkey;
-Hypoallergenic - No beef, pork, soya, eggs, wheat or dairy;
-Seaweed - Rich in iodine and other trace elements;
-Omega 3 and 6 Oils -With zinc, omega 3 and 6 fatty acids to support healthy skin and glossy coat.

Suitable for Adult Dogs Aged 1-7 years.

Approximate Dimensions (Product): 17 x 19 x 39.5cm

Dogs give us so much, which is why they deserve the very best care. We pour our expertise and passion into creating great, nutritionally balanced food that you can really trust.

Pets at Home Complete Nutrition for Adult Dogs is full of delicious chicken and vegetables to give your dog the balance it needs to stay strong and healthy. Enriched with vitamins and minerals, this delicious food is a tasty way to support your dog every day.

This Complete Nutrition Adult Dog Food could help with:
-Immunity Support - Added Vitamins and Minerals to help support a healthy immune system;
-Skin and Coat - Omega 3 and 6 to help support healthy skin and shiny coat;
-Healthy Digestion - Added chicory extract, a source of prebiotics to aid healthy digestion;
-Teeth and Bones - Calcium to support healthy teeth and bones;
-No added artificial colours or flavours.

Suitable for adult dogs aged 1-7 years. Not suitable for puppies under 1 year old.
